/*
export default () => {
  class World {
    static getTemperature(state,x,y,z) {
      return 1;
    }

    getState() {
      return {};
    }
  }

  self.addEventListener('message', e => { // eslint-disable-line no-restricted-globals
    if (!e) return;

    console.log("world:" + JSON.stringify(e.data.worldState));
    console.log("my temp: " + World.getTemperature(e.data.worldState,0,0,0));
    //console.log("my temp: " + World.getTemperature({},0,0,0));

  })
}
*/

Agent => {
  self.addEventListener('message', e => { // eslint-disable-line no-restricted-globals
    if (!e) return;

    console.log("world:" + JSON.stringify(e.data.worldState));

  })
}

export default Agent;
